%[text] load motivation file
clear
m = imread('motive.png'); 
m = flipud(m);
%%
szm = size(m) %[output:972aad38]
szm = szm([2 1]) %[output:746f03ad]
ctm = szm/2 %[output:1cb319c8]
%%
%[text] Draw Canvas

im = imshow(m) %[output:57c98b39] %[output:2f037966]

im.AlphaData = .1 %[output:0613fab9] %[output:2f037966]
axis on %[output:2f037966]
ax = gca() %[output:396ee047]
ax.YDir = "normal" %[output:5cb9fd6d] %[output:2f037966]
xline(ctm(1)) %[output:2f037966]
yline(ctm(2)) %[output:2f037966]
xlabel('x') %[output:2f037966]
%%
%[text] Draw upper Triangle
l = 250;
tht = pi*[0 2/3 4/3] +pi/2;
xo = l*cos(tht);
yo = l*sin(tht);
xc = ctm(1) %[output:66a53ec8]
yc = ctm(2) %[output:09f930a9]
ut = plg2(xo,yo,xc,yc) %[output:4bbeccd1]
ut.polyO %[output:08af5d9a] %[output:79591bbc]
ut.polyT %[output:8469c2a3] %[output:74ad7c34]
hold on %[output:63adee51]
ut.plot() %[output:6565ae45] %[output:6bc63e94] %[output:63adee51]
hold off %[output:63adee51]
%%
%[text] 

%%
%[text] Draw lower rectengle
lrec = l*sqrt(3) %[output:62ff473a]
x = [1 -1 -1 1]*lrec/2 + ctm(1) %[output:3199440a]
y = .2*[1 1 -1 -1]*lrec/2 + ctm(2) - l %[output:5b7a7909]
lr = polyshape(x,y) %[output:154dbd08]
hold on %[output:5a32b82f]
plot(lr) %[output:5a32b82f]
hold off %[output:5a32b82f]

